
<!DOCTYPE html>
<html lang="zh-Hant">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>For You</title>

<style>
body {
  margin: 0;
  font-family: "Microsoft JhengHei", sans-serif;
  background: linear-gradient(#ffd6e5, #ff9ecb);
  overflow: hidden;
}

#loginPage, #mainPage {
  width: 100vw;
  height: 100vh;
}

#loginPage {
  display: flex;
  justify-content: center;
  align-items: center;
}

.login-box {
  background: rgba(255,255,255,0.95);
  padding: 26px;
  border-radius: 20px;
  width: 85%;
  max-width: 320px;
  text-align: center;
}

.login-box input {
  width: 100%;
  padding: 12px;
  margin-top: 12px;
  border-radius: 10px;
  border: 1px solid #ccc;
  text-align: center;
}

.login-box button {
  width: 100%;
  margin-top: 14px;
  padding: 12px;
  border-radius: 12px;
  border: none;
  background: hotpink;
  color: #fff;
  font-size: 16px;
}

#mainPage {
  display: none;
  position: relative;
  overflow: hidden;
}

/* 浮動圖片背景 */
.float-img {
  position: absolute;
  width: 60px;
  height: 60px;
  object-fit: cover;
  border-radius: 14px;
  opacity: 0.35;
  animation: floatUp 10s linear forwards;
  z-index: 1;
}

@keyframes floatUp {
  from { transform: translateY(110vh) scale(1); }
  to { transform: translateY(-20vh) scale(1.3); }
}

/* 主內容 */
.content {
  position: relative;
  z-index: 5;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 10vh;
}

.heart-container {
  width: 220px;
  height: 200px;
  position: relative;
  margin-bottom: 20px;
}

.heart-container img {
  width: 70px;
  height: 70px;
  object-fit: cover;
  border-radius: 14px;
  position: absolute;
  box-shadow: 0 0 12px rgba(255,105,180,0.6);
}

.i1 { top: 0; left: 75px; }
.i2 { top: 65px; left: 0; }
.i3 { top: 65px; right: 0; }
.i4 { bottom: 0; left: 75px; }

.message {
  width: 90%;
  max-width: 360px;
  background: rgba(255,255,255,0.92);
  border-radius: 22px;
  padding: 20px;
  text-align: center;
  line-height: 1.7;
  color: #ff4f87;
  font-size: 14px;
}
</style>
</head>

<body>

<div id="loginPage">
  <div class="login-box">
    <h3>請輸入你的生日</h3>
    <p>例如 0804</p>
    <input id="keyInput" type="password">
    <button onclick="checkKey()">確認</button>
  </div>
</div>

<div id="mainPage">

  <div class="content">

function checkKey() {
  if (keyInput.value === "0925") {
    loginPage.style.display = "none";
    mainPage.style.display = "block";
    startFloating();
  } else {
    alert("Key 錯誤");
  }
}

function startFloating() {
  setInterval(() => {
    const img = document.createElement("img");
    img.src = imgs[Math.floor(Math.random()*imgs.length)];
    img.className = "float-img";
    img.style.left = Math.random()*100 + "vw";
    img.style.animationDuration = (8 + Math.random()*6) + "s";
    document.getElementById("mainPage").appendChild(img);
    setTimeout(()=>img.remove(), 12000);
  }, 600);
}
</script>
